import React from "react";

const Table = () => {
  return (
    <table
      class="table caption-top"
      style={{
        border: "1px solid black",
        fontSize: "38px",
      }}
    >
      <thead>
        <tr>
          <th>Header 1</th>
          <th>Header 2</th>
        </tr>
      </thead>
      <tbody>
        <tr data-bs-toggle="collapse" data-bs-target="#row1" class="clickable">
          <td>Row 1 Data 1</td>
          <td>Row 1 Data 2</td>
        </tr>
        <tr id="row1" class="collapse">
          <td colspan="2">Collapsible content for Row 1</td>
        </tr>
        <tr data-bs-toggle="collapse" data-bs-target="#row2" class="clickable">
          <td>Row 2 Data 1</td>
          <td>Row 2 Data 2</td>
        </tr>
        <tr id="row2" class="collapse">
          <td colspan="2">Collapsible content for Row 2</td>
        </tr>
      </tbody>
    </table>
  );
};

export default Table;
